import React from 'react';
import MyCard from '../../../General/Card/card.js'
import IdeasCards from './ideasJson.js'

class Ideas extends React.Component{
  render() {
    const ideasCards = IdeasCards.map(oneitem =>
        <MyCard
           img_variant = {oneitem.img.variant}
           img_src = {oneitem.img.src}
           text = {oneitem.text}
           btn_variant = {oneitem.button.variant}
           btn = {oneitem.button.btn}
         />
       )
    return (
      <div>
        {ideasCards}
      </div>
    )
  }
}
export default Ideas
